import React from "react";
import "./style/burger.css";
import prof from "../../image/icone/profile.png";
function Burger() {
  return (
    <div className="burger-menu">
        <div className="burger-menu__"></div>
      <img src={prof} alt="404" />
    </div>
  );
}

export default Burger;
